        d3.csv("./all-nodes.csv").then(data => {
            console.log(data);
            d3.select("#vis")
                .append("svg")
                .append("circle")
                .attr("r", 5)
                .attr("cx", this.props.width / 2)
                .attr("cy", this.props.height / 2)
                .attr("fill", "red");
        });
        return (
            <div className="vis" width=""/>
